window.bookSummaryJSON = "<p>Just as Midshipman Alexis Carew thinks she's found a place in the Royal Navy, she's transferred aboard H.M.S. <i>Hermione</i>. Her captain is a Tartar, liberal with the cat, who thinks girls have no place aboard ship. The other midshipmen in the berth are no better and the only advice she's offered is to keep her head down and mouth shut - things Alexis is rarely able to do.</p>"; 
